    <ReactPlayer
      url="https://www.youtube.com/embed/4HPfUrO5fBY&t=1s?showinfo=0&enablejsapi=1&origin=http://localhost:3000"
      playing={true}
      volume={0.3}
      loop={true}
      width={960}
      height={540}
      style={{  zIndex: '-4', filter: 'brightness(60%)', margin: '0 auto'}}
    />
    <img src={bannerFrame} style={{position: "absolute",
    width: "95%",
    top: "-20px",
    left: "25px",}}/>

